import React from "react";
import "./style.css";
// import image from "../../utils/photos/brand.jpg";

function Nav() {
  return (
    <div>
    <div id='nav-title'>Will Wojeck</div><br />
    <div id='nav-links'>
      <div class='nav-link' id='bio'><a href='/'>Bio</a></div>
      <div onclick="window.location.href = '/projects';"class='nav-link' id='projects'><a href=''></a>Projects</div>
      <div onclick="window.location.href = '/resume';" class='nav-link' id='resume'>Resume</div>
      <div onclick="window.location.href = '/contact';" class='nav-link' id='contact'>Contact</div>
    </div>
    </div>
  );
}

export default Nav;
